CREATE TABLE COMMITS(
    repo        VARCHAR(64),
    id          VARCHAR(16),
    space       INTEGER,
    time        INTEGER,
    timestamp   TIMESTAMP,
    message     TEXT,
    author      VARCHAR(64),
    login       VARCHAR(32),
    avatar      VARCHAR(128),
    parents     TEXT,
    PRIMARY KEY(id)
);

CREATE TABLE SECTION(
    filename    VARCHAR(128),
    author      VARCHAR(64),
    commitid    VARCHAR(16),
    message     TEXT,
    timestamp   TIMESTAMP,
    lines       TEXT,
    fullname    VARCHAR(256),
    repo        VARCHAR(64) 
);

CREATE TABLE REPO(
    name      VARCHAR(64),
    url       VARCHAR(128),
    files     TEXT
);





